import React from 'react';
import { Drawer, List, ListItem } from '@mui/material';

const SideDrawer = (props) => {
  return (
    <Drawer anchor='right' open={props.open}>
      <List component='nav'>
        <ListItem button onClick={() => alert('click')}>
          Name of Items
        </ListItem>
      </List>
    </Drawer>
  );
};

export default SideDrawer;
